import React from 'react';
import { connect, useSelector } from "react-redux";
import ContConsoleButton from '../ConsoleButton/ContConsoleButton'
import ContHeaderDictionary from '../Header/ContHeaderDictionary'
import ContTable from '../Table/ContTable'
import ContEditWindow from '../EditWindow/ContEditWindow'

function ViewType (props){
    
    const flagOpenEditWindow = useSelector(state => state.WindowCreateNewData.flag);
    const [flag, setFlag] = useState(flagOpenEditWindow)
    
    return(
        <div>
            <ContHeaderDictionary />
            <ContConsoleButton />
            <ContTable />
        
        {
            flag == true ?
            <ContEditWindow />
            :null
        
        }
        </div>
    )
}

export default connect()(ViewType)
